import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="nav container">
      <Link to={'/'} className="nav_logo">
        {'Mohit'}
      </Link>

      .nav_menu
    </nav>
  );
};

export default Navbar;
